I am trying to understand how a java bytecode works. I have read some articles about it but I still don't understand how it works. Can you give me an example of a java bytecode for a simple program?
asked Mar 8, 2021 in JAVA by SakshiSharma
Java bytecode is the instruction set for the Java Virtual Machine. It acts similar to an assembler which is an alias representation of a C++ code. As soon as a java program is compiled, java bytecode is generated. It is the task of the JVM to take that bytecode and convert it to machine code. The bytecode is stored in a .class file.
Let’s take a simple example to understand this. The following program outputs Hello World.
public class HelloWorld{
System.out.println("Hello World");
The bytecode for the above program is as follows:
Compiled from "HelloWorld.java"
public class HelloWorld extends java.lang.Object{
public HelloWorld();
Code:
0: aload_0
1: invokespecial #1; //Method java/lang/Object."<init>":()V
4: return
public static void main(java.lang.String[]);
Code:
0: getstatic #2; //Field java/lang/System.out:Ljava/io/PrintStream;
3: ldc #3; //String Hello World
5: invokevirtual #4; //Method java/io/PrintStream.println:(Ljava/lang/String;)V
8: return
}
